import axios from 'axios';

class Members extends React.Component {
  constructor(props) {
    super(props);
    this.state = { 
        name: 'Members!'
    };
  }

  render() {
    return (
      <h1>{this.state.name}</h1>
    );
  }
}

export default Members;
